package org.jzw.yxbs.domain;import java.util.Date;public class User {		private Long id;	private String username;	private String passwd;	private String role;	private Integer isenable;	private Date createDate;	private Date modifyDate;		public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getUsername() {		return username;	}	public void setUsername(String username) {		this.username = username;	}	public String getPasswd() {		return passwd;	}	public void setPasswd(String passwd) {		this.passwd = passwd;	}	public String getRole() {		return role;	}	public void setRole(String role) {		this.role = role;	}	public Integer getIsenable() {		return isenable;	}	public void setIsenable(Integer isenable) {		this.isenable = isenable;	}	public Date getCreateDate() {		return createDate;	}	public void setCreateDate(Date createDate) {		this.createDate = createDate;	}	public Date getModifyDate() {		return modifyDate;	}	public void setModifyDate(Date modifyDate) {		this.modifyDate = modifyDate;	}	}